-------- USUŃ TABELE --------

DROP TABLE IF EXISTS Transakcje;
DROP TABLE IF EXISTS Asortyment;
DROP TABLE IF EXISTS Klienci;

--------- CREATE - UTWÓRZ TABELE I POWIĄZANIA --------

CREATE TABLE Asortyment
(
    id_asortymentu    VARCHAR(3) PRIMARY KEY,
    nazwa_asortymentu VARCHAR(36),
    cena_jenostkowa   INT
);

CREATE TABLE Klienci
(
    id_klienta  VARCHAR(9) PRIMARY KEY,
    imie        VARCHAR(14),
    nazwisko    VARCHAR(24),
    prefix_nip  INTEGER,
    NIP         VARCHAR(14),
    wojewodztwo VARCHAR(19),
    kod         VARCHAR(6),
    miejscowosc VARCHAR(24),
    ulica       VARCHAR(79),
    nr_domu     INTEGER 
);

CREATE TABLE Transakcje
(
    id_transakcji   VARCHAR(13) PRIMARY KEY,
    klient          VARCHAR(9) REFERENCES Klienci(id_klienta),
    asortyment      VARCHAR(3) REFERENCES Asortyment(id_asortymentu),
    ilosc           NUMERIC(5, 2),
    data_transakcji VARCHAR(19)
);


